    display: flex;
    justify-content: center;
    > input {
        padding: 10px 5px;
        width: 40%;
    }    
`


const Search = ({ onChange }) => {
    return (
        <Container>
            <input onChange={handleChange}/>
        </Container>
    );
}

export default Search;
